import React from "react";
import {Link} from "react-router-dom"
import styled from 'styled-components'

const StyleNav = styled.div`
*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}
.navbarp{
    display: flex;
    justify-content: center;
    align-items: center;
    height: 90px;
    background: #3f3f3f;
    color: black;
    font-family: 'Raleway', sans-serif;
    box-shadow: 0 4px 6px rgb(0 0 0 / 30%);
}
.navbarp h3{
    display: flex;
    justify-content: flex-end!important;
    margin-left: 30%;
}
a { color: white !important } 
.logo{
    font-size: 30px;
}
.nav-links{
    display: flex;
    justify-content: flex-end !important;
    list-style: none;
    width: 75px;
    margin-left: 90%;
}
.home,.about,.skills,.projects,.contact{
     text-decoration: none;
     color: white;
     font-size: 20px;
     padding: 10px 20px;
     margin: 0 10px;
     cursor: pointer;
}
@media screen and (max-width: 600px) {
  .topnav a:not(:first-child) {display: none;}
  .topnav a.icon {
    float: right;
    display: block;
  }
}
@media screen and (max-width: 600px) {
  .navbarp.responsive {position: relative;}
  .navbarp.responsive a.icon {
    position: absolute;
    left: 0;
    top: 0;
  }
  .navbarp.responsive a {
    float: none;
    display: block;
    text-align: left;
  }
}


`

export default function Navbar() {
